import React from 'react';
import {observer} from 'mobx-react';
import './Modal.css';

const Modal = observer(({show}) => {

    return (
        <>
            <div className="maskingPage"></div>
            <div className="modalPage">
               <div className="modalPage_header"></div> 
            </div>
        </>
    )
});


export default Modal;
